import Footer from '../Components/Footer';
import CarouselBigBox from '../Components/CarouselBigBox';
import ColoredBoxSet from '../Components/ColoredBoxSet';
import BigHeading from "../Components/BigHeading"

function About(){
    let intro = <div>
        <h1><strong>DieTITIAN Rashu MALHOTRA</strong></h1><br></br>
        M.sc  Foods and Nutrition, B.Ed.<br></br>
        (Online Consulation Available)
    </div>
    let element = [
        {
            title : "SERVICES / DIET PLANS OFFERED",
            content: <ul>
                            <li>Healthy Living</li>
                            <li>Weight Loss</li>
                            <li>Weight Gain</li>
                            <li>Body Building</li>
                            <li>Therapeutic diets</li>
                            <li>Diabetes</li>
                            <li>Hypertention</li>
                            <li>Thyroid</li>
                            <li>Pregnancy</li>
                            <li>Clear skin</li>
                        </ul>,
        },{
            title: "Get detailed and systematic diet charts",
            content: <div>
                Weekly consultation over the phone <br></br>
                Diet plans @WhatsApp/ SMS/Email.<br></br>
                Pay thru PayTM/Mobiwik/Internet banking/Cash/Cheque
            </div>
        }

            ]
    return(
        <div>
            <BigHeading
                Image="Maam.gif"
                Title="ABOUT"
                Content = {intro}
            />


            <ColoredBoxSet 
                Title=""
                Content={element}
            />

            <CarouselBigBox Title="Succes stories from our lovely clients"/>
            <Footer/>
        </div>
    );
}

export default About;
